import React from 'react';

import { BrowserRouter as Router, Route, Redirect, Switch } from 'react-router-dom';
import Users from './user/pages/Users';
import NewPlace from './places/pages/NewPlaces';
function App() {
  return (
    <Router>
      <Switch></Switch>
      <Route path="/" exact>
        <Users />
      </Route>

      <Route path="/places/new">
        <NewPlace />
      </Route>

      <Redirect to="/" />

    </Router>
  );
}

export default App;
